import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Use Routes instead of Switch

import './App.css';
import Showcase from './Showcase'; // Update to match the actual filename
import PasswordChecker from './PasswordChecker'; // Adjust the path if necessary
import NextPage from './NextPage'; // Import your next page component

const App = () => {
    return (
        <Router>
            <div className="Start-container">
                <Showcase />
                <Routes> {/* Use Routes instead of Switch */}
                    <Route path="/" element={<PasswordChecker />} /> {/* Use element prop */}
                    <Route path="/next" element={<NextPage />} /> {/* Use element prop */}
                </Routes>
            </div>
        </Router>
    );
};

export default App;
